DROP TABLE product_prices;

CREATE TABLE `product_prices` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) DEFAULT NULL,
  `price_type_id` int(11) DEFAULT NULL,
  `price` double DEFAULT NULL,
  `last_price` double DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17740 DEFAULT CHARSET=utf8;




DROP TABLE products;

CREATE TABLE `products` (
  `product_id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `brand_id` int(11) DEFAULT 0,
  `category_id` int(11) unsigned NOT NULL DEFAULT 0,
  `supplier_id` int(11) unsigned NOT NULL DEFAULT 0,
  `product_name` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `long_description` varchar(300) COLLATE latin1_general_ci DEFAULT NULL,
  `measurement` varchar(100) COLLATE latin1_general_ci DEFAULT NULL,
  `unit_of_measure_amount` int(11) DEFAULT NULL,
  `units_of_measurement_id` int(11) unsigned NOT NULL DEFAULT 1,
  `show_unit_of_measure` tinyint(4) DEFAULT 0 COMMENT 'show in receipt if true',
  `cost_per_unit` double DEFAULT 0,
  `quantity` double DEFAULT 0,
  `last_po_quantity` double DEFAULT 0,
  `alert_quantity` double DEFAULT 0,
  `vat_status` varchar(10) COLLATE latin1_general_ci DEFAULT 'yes',
  `tax_id` int(11) DEFAULT 1,
  `product_status_id` int(11) unsigned NOT NULL,
  `date_added` datetime DEFAULT NULL,
  `image` varchar(255) COLLATE latin1_general_ci DEFAULT NULL,
  `product_section_id` int(11) unsigned NOT NULL,
  `room_floor_id` int(11) DEFAULT 0,
  `product_type_id` int(11) DEFAULT NULL,
  `pick_product` tinyint(4) DEFAULT 0,
  `commission_price` double DEFAULT 0,
  `box_pack` double DEFAULT 0,
  `invisible` tinyint(4) DEFAULT 0,
  `default` tinyint(4) DEFAULT 0 COMMENT 'Default products',
  PRIMARY KEY (`product_id`),
  UNIQUE KEY `code` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=9798 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

